import React from 'react'
import { Nav, Navbar, NavbarBrand, } from 'react-bootstrap'

const Header = () => {
    return (
        <Navbar>
            <NavbarBrand>
                <a href="#">Max Nilsson</a>
            </NavbarBrand>
        </Navbar>
    )
}

export default Header
